import './App.css';
import './Mobile.css';

function App() {
  return (
    <div className="container-fluid">
      <nav class="navbar fixed-top navbar-dark bg-dark">
        <a class="navbar-brand" href="http://localhost:3000">Fixed top</a>
        <div>
          search
        </div>
      </nav>

      <div class="row">
        <div class="col">
          One of three columns
        </div>
        <div class="col-8">
          One of three columns
        </div>
      </div>
      {/* <!--img src={logo}
            data-src-600px="image-600px.jpg"
            data-src-800px="image-800px.jpg"
            alt=""></img--> */}

    </div>

  );
}

export default App;
